// import utils
import PublicRoute from "../utils/PublicRoute.js";
import { Button1 } from "../utils/buttons";
import { Input1, Input2 } from "../utils/inputs";

const Contact = () => {
  const content = (
    <>
      <Input1 />
      <Input1 />
      <Input2 />
      <Button1 />
    </>
  );

  return <PublicRoute title="contact" content={content} />;
};

export default Contact;
